Feminist will always believe and stand in solidarity with survivors. 

🎞 Via @therecount “Olympic gymnasts take the Hill to testify against former USA Gymnastics doctor Larry Nassar in front of Congress. Here are their opening statements:”

@simonebiles: “I blame Larry Nassar, and I also blame an entire system that enabled and perpetrated his abuse.”

@alyraisman: “It was like serving innocent children up to a pedophile on a silver platter.”

@mckaylamaroney: “If they’re not going to protect me, I want to know, who are they trying to protect?”

Happy Hispanic Heritage Month! 
 September 15 to October 15 is National Hispanic American Heritage Month, We celebrate Hispanic Heritage Month to recognize the achievements and contributions of Hispanic American.

To kick off  the celebrations here are some of our favorite communities to follow and support this month and beyond! ⬇️

@weallgrowlatina A community and organization elevating the voices + stories of Latinas since 2010.

@theluzcollective
Telling stories and disrupting stereotypes. We are a media brand by Latinas, for Latinas.

@latinxparenting
Latinx Parenting believes in shifting the paradigm of raising children towards creating a trauma-informed, healing centered, nonviolent and cultural sustaining approach where Latinx familias can nurture connection in their homes in ways that support individual, family & intergenerational collective healing.

@cubanospalante
A community of Cuban Americans moving our gente PA’LANTE until we are all free

@latinatolatina
A podcast with your weekly dose of Latina greatness

@latinasforclimate
Red internacional de jóvenes feministas por la justicia climática interseccional en América Latina y el Caribe

@translatinacoalition
The TransLatin@ Coalition (TLC) is an organization of transgender Latina leaders donating their time to organize & advocate for the issues and needs of Trans Latin@ community living in the United States.

@therapyforlatinx
Virtual directory to search for therapists for Latinx people

@latinwomeninaction
A nonprofit organization helping to empower, support, and motivate the Latinx and Hispanic community for 30+ years. Based in Queens, NY 

@aintilatina
Digital destination celebrating and highlighting Afro-Latinx womanhood

@r29somos Telling our stories and shifting the narrative, para nosotros

@latinarebels
5 Latinas unveiling the complexities of Latinidad

@theafrolatindiaspora
A non-profit org decolonizing & redefining the narrative of AfroLatinidad within the African Diaspora

@votolatino
Voto Latino is a grassroots political organization focused on educating and empowering a new generation of Latinx voters, as well as creating a more robust and inclusive democracy.

